import json
from datetime import datetime, timezone
import pytz

def parse_to_utc(dt_str: str) -> datetime:
    """Parse an ISO 8601 datetime string to a UTC datetime object."""
    if dt_str.endswith('Z'):
        dt_str = dt_str[:-1] + '+00:00'

    try:
        dt = datetime.fromisoformat(dt_str)
    except ValueError:
        raise ValueError(f"Invalid datetime format: {dt_str}")

    if dt.tzinfo is None:
        dt = dt.replace(tzinfo=timezone.utc)

    return dt.astimezone(timezone.utc)

def slack_date_format(dt: datetime, label="") -> str:
    """Format a datetime for Slack's date formatting."""
    utc_ts = int(dt.astimezone(timezone.utc).timestamp())
    fallback_text = dt.astimezone(timezone.utc).strftime('%Y-%m-%d %I:%M:%S %p UTC')

    if label:
        return f"{label} <!date^{utc_ts}^<<date_short_pretty>> <<time>>|{fallback_text}>"
    else:
        return f"<!date^{utc_ts}^<<time>>|{fallback_text}>"

def format_date_if_different(start_dt: datetime, end_dt: datetime) -> str:
    """Format a date range using Slack's date formatting."""
    start_utc = start_dt.astimezone(timezone.utc)
    end_utc = end_dt.astimezone(timezone.utc)

    start_formatted = slack_date_format(start_utc, label="For")
    end_formatted = slack_date_format(end_utc, label="")

    return f"{start_formatted} - {end_formatted}"

def main(input_data: dict) -> dict:
    """Main function to process PTO events and generate Slack messages."""
    pto_events_str = input_data.get('PTO_events', '[]')
    try:
        pto_events = json.loads(pto_events_str)
    except json.JSONDecodeError:
        raise ValueError("Invalid JSON format for PTO events.")

    # Sort PTO events by start time
    pto_events.sort(key=lambda e: parse_to_utc(e.get('start', {}).get('dateTime', '9999-12-31T23:59:59Z')))

    # Set default header and member takers
    header = input_data.get(
        'heading', 
        {"type": "section", "text": {"type": "plain_text", "text": "Someone is taking PTO!", "emoji": True}}
    )
    member_takers = input_data.get('member_takers')

    all_messages = [
        {"blocks": [header, member_takers], "text": "PTO coverage request", "meeting_id": "header", "action_id": "header"}
    ]

    for idx, event in enumerate(pto_events, start=1):
        start_raw = event.get('start', {}).get('dateTime')
        end_raw = event.get('end', {}).get('dateTime')

        if not start_raw or not end_raw:
            continue

        pto_start = parse_to_utc(start_raw)
        pto_end = parse_to_utc(end_raw)
        formatted_time_range = format_date_if_different(pto_start, pto_end)

        action_id = f"action_{idx}"
        details_id = f"detail_{idx}"
        cancel_action_id = f"cancel_{idx}"

        event_message = {
            "blocks": [
                {
                    "type": "section",
                    "text": {
                        "type": "mrkdwn",
                        "text": f"*{event.get('summary', 'PTO Event')}*\n{formatted_time_range}"
                    }
                },
                {
                    "type": "actions",
                    "elements": [
                        {
                            "type": "button",
                            "text": {
                                "type": "plain_text",
                                "text": "I'll take it!",
                                "emoji": True
                            },
                            "value": "take it",
                            "style": "primary",
                            "action_id": action_id
                        },
                            {
                              "type": "button",
                              "text": {
                                "type": "plain_text",
                                "text": "More Info",
                                "emoji": True
                              },
                              "value": "Details",
                              "action_id": details_id
                            }
                    ]
                }
            ],
            "text": f"PTO Event: {event.get('summary', 'PTO Event')}",
            "meeting_id": event.get('id', 'Unknown Event'),
            "action_id": action_id,
            "URL_link": event.get('htmlLink', '')
        }

        all_messages.append(event_message)

    return {"messages": all_messages}

from typing import List, Dict

def main(input: List[List[Dict]]):
    meetings = input[1]
    info_objects = input[0]

    for meeting in meetings:
        meeting_name = meeting.get("text")
        for info_object in info_objects:
            if info_object.get("current_value") == meeting_name:
                info_key = next((key for key in info_object if key.endswith("_info")), None)
                if info_key:
                    meeting["info_details"] = info_object.get(info_key)
                meeting["vitally_note_url"] = info_object.get("vitally_note_url")
                break

    return meetings

import re

def main(input):
    date_patterns = r'<!date\^(\d+)\^(.*?)\|(\d{4}-\d{2}-\d{2} \d{2}:\d{2}:\d{2} [AP]M UTC)>'
    matches = re.findall(date_patterns, input)

    if len(matches) >= 2:
        timestamp1, datetime1 = matches[0][0], matches[0][2]
        timestamp2, datetime2 = matches[1][0], matches[1][2]
        return f'<!date^{timestamp1}^{datetime1}|{datetime1}> - <!date^{timestamp2}^{datetime2}|{datetime2}>'
    else:
        return ''
